    C_ParamCon.prototype.DigitouDestinoLancamento = function () {
        var parametro = {
            codigo: this.txtContaDestinoZeramento.TextBoxAdicional.value.CNum(),
            codEmpresa: ValoresSismoura.EmpresaPadraoUsuario
        };
        if (this.ExecutarFuncaoServerSideSynch("IsContaSinteticaReduzido", parametro)) {
            MostrarAlerta('Informe uma conta contábil do Tipo Analítica');
            this.txtContaDestinoZeramento.Limpar();
            this.txtContaDestinoZeramento.Focus();
            return;
        }
    };
    C_ParamCon.prototype.OnExcluirItemGrade = function (s, e) {
        try {
            var parametros = {
                codConta: e.item.Conta,
                tela: ValoresSismoura.NomeTela,
                codUsuario: ValoresSismoura.UsuarioLogado,
                Empresa: this.cboEmpresa.GetValue()
            };
            var retorno = this.ExecutarFuncaoServerSideSynch("ExcluirContaConsolidacao", parametros);
            if (retorno)
                MostrarMensagem("Conta excluída com sucesso!");
            else
                MostrarError("Ocorreu um erro no sistema");
        }
        catch (ex) {
            LogarException(ex);
        }
    };
    C_ParamCon.prototype.OnCboEmpresaOrigemChange = function () {
        var _this = this;
        var parametros = {
            Matriz: this.cboEmpresaOrigem.GetValue()
        };
        this.lstEmpresaDestino.RemoverTodosItens(true);
        abrirEspera("");
        this.ExecutarFuncaoServerSideAsynch("GetFiliais", parametros, function (d) {
            fecharEspera();
            var Filiais = GetRetornoAJAX(d);
            for (var x = 0; x <= Filiais.length - 1; x++) {
                _this.lstEmpresaDestino.AdicionarItem(Filiais[x].Fantasia, Filiais[x].Codigo);
            }
        }, this.TratarErroFuncaoAsync, this);
    };
    C_ParamCon.prototype.OnClicouBotaoLinhaConta = function (s, e) {
        try {
            if (!e.item) {
                return;
            }
            var parametros = {
                codigoConta: e.item.Codigo
            };
            if (this.ExecutarFuncaoServerSideSynch("ExcluirConta", parametros)) {
                MostrarMensagem("Excluído com sucesso!");
            }
            else {
                MostrarAlerta("Não foi possível excluir o item.");
            }
        }
        catch (ex) {
            LogarException(ex);
        }
    };
    C_ParamCon.prototype.OnClicouBotaoContaCaixa = function (s, e) {
        try {
            if (!e.item.Codigo) {
                return;
            }
            var parametros = {
                codLivroCx: e.item.Codigo,
                codEmpresa: this.cboEmpresa.GetValue(),
                tela: ValoresSismoura.NomeTela,
                codUsuario: ValoresSismoura.UsuarioLogado
            };
            if (e.item.Codigo > 0) {
                if (this.ExecutarFuncaoServerSideSynch("ExcluirContaLivroCaixa", parametros)) {
                    MostrarMensagem("Conta excluída com sucesso!");
                }
                else {
                    MostrarAlerta("Não foi possível excluir o item.");
                }
            }
        }
        catch (ex) {
            LogarException(ex);
        }
    };
