    C_ParamCon.prototype.PreencherTela = function (empresa) {
        var _this = this;
        var parametros = {
            codEmpresa: empresa
        };
        abrirEspera("");
        this.ExecutarFuncaoServerSideAsynch("PreencherTela", parametros, function (d) {
            fecharEspera();
            var retorno = GetRetornoAJAX(d);
            if (retorno) {
                _this.cboEmpresa.SetValue(retorno.Empresa);
                //Encerramento
                _this.txtContaDestinoZeramento.Procurar(retorno.Conta_Destino_Zeramento);
                _this.txtHistoricoZeramento.Procurar(retorno.Zeramento_Historico);
                if (retorno.Transfere) {
                    _this.chkTransfere.Checked = true;
                    _this.txtContaLucro.Enabled = true;
                    _this.txtContaPrejuizo.Enabled = true;
                    _this.txtHistoricoTransferencia.Enabled = true;
                    _this.txtHistoricoTransferencia.PermitirProcurar = true;
                    _this.txtContaLucro.Procurar(retorno.Conta_Lucro);
                    _this.txtContaPrejuizo.Procurar(retorno.Conta_Prejuizo);
                    _this.txtHistoricoTransferencia.Procurar(retorno.Transfere_Historico);
                }
                else {
                    _this.chkTransfere.Checked = false;
                    _this.txtHistoricoTransferencia.Enabled = false;
                    _this.txtHistoricoTransferencia.PermitirProcurar = false;
                    _this.txtContaLucro.Procurar(retorno.Conta_Lucro);
                    _this.txtContaPrejuizo.Procurar(retorno.Conta_Prejuizo);
                }
                _this.txtContaDebIRPJ.Procurar(retorno.Irpj_Conta_Debito);
                _this.txtContaCredIRPJ.Procurar(retorno.Irpj_Conta_Credito);
                _this.txtHistoricoIRPJ.Procurar(retorno.Irpj_Historico);
                _this.txtContaDebCSLL.Procurar(retorno.Csll_Conta_Debito);
                _this.txtContaCredCSLL.Procurar(retorno.Csll_Conta_Credito);
                _this.txtHistoricoCSLL.Procurar(retorno.Csll_Historico);
                //Livro Diário
                _this.txtDiarioLivro.SetText(retorno.Diario_Livro);
                _this.txtDiarioPagina.SetText(retorno.Diario_Pagina);
                _this.txtDiarioQtdePaginas.SetText(retorno.Diario_Qtde_Paginas);
                //Integração
                _this.cboIntegracaoCartao.SetValue(retorno.Integracao_Venda_Cartao);
                _this.cboIntegracaoNotaEntrada.SetValue(retorno.Integracao_Nota_Entrada);
                _this.txtContaSintetica.Procurar(retorno.Conta_Fornecedor_Individual);
                _this.chkAtivarModulo.Checked = retorno.Empresa_Ativa;
                _this.hdnContaSintetica.value = retorno.Conta_Fornecedor_Individual;
                _this.PreencherIntegracaoNotaEntrada();
                _this.OnAtivarCheckChanged();
            }
            else {
                _this.LimparCampos();
                _this.PreencherGradeContas();
                _this.PreencherGradeTransferencia();
            }
        }, this.TratarErroFuncaoAsync, this);
    };
