    C_ParamCon.prototype.OnValidandoItemConsolidacao = function (s, e) {
        try {
            if (this.txtConsolidacaoContaContabil.TextBoxAdicional.value == "" || this.txtConsolidacaoContaContabil.GetText() == "") {
                MostrarAlerta("Informe uma conta!");
                this.txtConsolidacaoContaContabil.Focus();
                e.cancelar = true;
            }
            var lista = this.Consolidacoes.FindAll("Conta", this.txtConsolidacaoContaContabil.GetText().CNum());
            if (lista.length > 0) {
                MostrarAlerta("Conta Contábil já Informada");
                this.txtConsolidacaoContaContabil.Limpar();
                this.txtConsolidacaoContaContabil.Focus();
                e.cancelar = true;
            }
            else {
                var parametros = {
                    codConta: this.txtConsolidacaoContaContabil.GetText().CNum(),
                    Empresa: this.cboEmpresa.GetValue()
                };
                var retorno = this.ExecutarFuncaoServerSideSynch("BuscarContaConsolidada", parametros);
                if (retorno) {
                    e.item.Conta = retorno[0].Conta;
                    e.item.Reduzido = retorno[0].Reduzido;
                    e.item.Classificacao_Contabil = retorno[0].Classificacao_Contabil;
                    e.item.Descricao_Conta = retorno[0].Descricao_Conta;
                    e.item.Empresa = retorno[0].Empresa;
                }
            }
        }
        catch (ex) {
            LogarException(ex);
        }
    };
