    C_ParamCon.prototype.OnPageLoad = function () {
        var _this = this;
        _super.prototype.OnPageLoad.call(this);
        this.ContasLivroCaixa = [];
        this.LimparCampos();
        this.PreencherGradeContas();
        this.PreencherGradeGrupos();
        this.PreencherGradeTransferencia();
        this.PreencherGradeConsolidacao();
        this.PreencherIntegracaoNotaEntrada();
        this.PreencherGradeLivroCaixa();
        this.PreencherTela(ValoresSismoura.EmpresaPadraoUsuario);
        this.VerificaCheckTransfere();
        this.PreencherAbaEcf(this.cboEmpresa.GetValue());
        this.ValidaAbaEcf();
        this.PreencherAbaApuracao(this.cboEmpresa.GetValue());
        this.txtCnpjScp.SetTextLabelControl("CNPJ da SCP");
        var parametros = {
            Matriz: this.cboEmpresa.GetValue()
        };
        abrirEspera("");
        this.ExecutarFuncaoServerSideAsynch("GetFiliais", parametros, function (d) {
            fecharEspera();
            var Filiais = GetRetornoAJAX(d);
            for (var x = 0; x <= Filiais.length - 1; x++) {
                _this.lstEmpresaDestino.AdicionarItem(Filiais[x].Fantasia, Filiais[x].Codigo);
            }
        }, this.TratarErroFuncaoAsync, this);
    };
